import React from "react";
import "./../styles/Quotations.css";

const Quotations = () => {
  return (
    <section className="quote-section">
      <h2>Inspirational Movie Quotes</h2>
      <div className="quote-container">
        <p>"Just keep swimming." - Finding Nemo</p>
        <p>"There's no place like home." - The Wizard of Oz</p>
        <p>"You talking to me?" - Taxi Driver</p>
        <p>"May the Force be with you." - Star Wars</p>
        <p>"Life is like a box of chocolates." - Forrest Gump</p>
      </div>
    </section>
  );
};

export default Quotations;
